import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
const Payload = () => {
  const [data, setData] = useState([]);
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/payloads")
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return (
    <div>
      Lorem ipsum, dolor sit amet consectetur adipisicing elit. Maiores iure
      iste asperiores quasi quaerat, debitis quae perspiciatis! Eos itaque
      tempore perspiciatis incidunt dolore adipisci laboriosam! Quibusdam
      numquam atque tempora possimus.
    </div>
  );
};

export default Payload;
